import React from 'react';
import './DashboardEnhancementsReadonly.css';
import { toast } from 'react-toastify';
interface EnhancementProps {
  autoCount: number;
  motoCount: number;
  tirCount : number,
  latestAuto: { id: number; modello: string; targa: string }[];
  latestMoto: { id: number; modello: string; targa: string }[];
  latestTir: { id: number; modello: string; targa: string }[];

}
const showComingSoonToast = () => {
    toast.info("🚧 Funzionalità di acquisto in arrivo", {
        position: "top-center",
        className: "custom-toast", // ✅ questa è corretta
        autoClose: 3000,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: false,
        hideProgressBar: false
      });
      
      
      
      
  };

  const acquistaVeicolo = async (
    tipo: 'auto' | 'moto' | 'tir',
    id: number
  ) => {
    const token = localStorage.getItem('token'); // oppure prendi da contesto auth
  
    if (!token) {
      toast.error("Token mancante. Effettua il login.");
      return;
    }
  
    const payload: any = {
      acquistiBean: {}
    };
  
    if (tipo === 'auto') payload.acquistiBean.extAutoId = id;
    if (tipo === 'moto') payload.acquistiBean.extMotoId = id;
    if (tipo === 'tir') payload.acquistiBean.extTirId = id;
  
    try {
      const res = await fetch('/insertAcquisto', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
        body: JSON.stringify(payload)
      });
  
      const data = await res.json();
  
      if (data.errorCode === 0) {
        toast.success("✅ Acquisto completato!");
      } else {
        toast.error(`❌ ${data.errorMessage || "Errore durante l'acquisto"}`);
      }
    } catch (err) {
      toast.error("❌ Errore di rete durante l'acquisto");
      console.error(err);
    }
  };
  
  
const DashboardEnhancementsReadonly: React.FC<EnhancementProps> = ({
  autoCount,
  motoCount,
  tirCount,
  latestAuto,
  latestMoto,
  latestTir
}) => {
  return (
    <div className="dashboard-enhancements">
      <div className="stats-grid">

       {/* Automezzi */}
<div className="stat-block">
  <div className="stat-box">
    <h3>{autoCount}</h3>
    <p>Automezzi registrati</p>
  </div>
  <div className="stat-list">
    <div className="list-header">
      <h4>Ultimi automezzi inseriti</h4>
    </div>
    <ul>
      {latestAuto.map((a, idx) => (
        <li key={idx}>
          {a.modello} - {a.targa}
          <button onClick={() => acquistaVeicolo('auto', a.id)}>
            🛒 Acquista
          </button>
        </li>
      ))}
    </ul>
  </div>
</div>

{/* Moto */}
<div className="stat-block">
  <div className="stat-box">
    <h3>{motoCount}</h3>
    <p>Moto registrate</p>
  </div>
  <div className="stat-list">
    <div className="list-header">
      <h4>Ultime moto inserite</h4>
    </div>
    <ul>
      {latestMoto.map((m, idx) => (
        <li key={idx}>
          {m.modello} - {m.targa}
          <button onClick={() => acquistaVeicolo('moto', m.id)}>
            🛒 Acquista
          </button>
        </li>
      ))}
    </ul>
  </div>
</div>

{/* Tir */}
<div className="stat-block">
  <div className="stat-box">
    <h3>{tirCount}</h3>
    <p>Tir registrati</p>
  </div>
  <div className="stat-list">
    <div className="list-header">
      <h4>Ultimi Tir inseriti</h4>
    </div>
    <ul>
      {latestTir.map((t, idx) => (
        <li key={idx}>
          {t.modello} - {t.targa}
          <button onClick={() => acquistaVeicolo('tir', t.id)}>
            🛒 Acquista
          </button>
        </li>
      ))}
    </ul>
  </div>
</div>


      </div>
    </div>
  );
};

export default DashboardEnhancementsReadonly;
